import React, { Component } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

class PersonList extends Component {
    state = {
        persons: []
    };

    componentDidMount() {
        axios.get(`https://randomuser.me/api/?results=10`)
            .then(res => {
                console.log(res.data);
                const persons = res.data.results;
                this.setState({ persons });
            });
    }

    render() {
        return (
            <div style={{ backgroundColor: '#28a745', padding: '20px' }}>
                <h1 style={{ textAlign: 'center', color: 'white' }}>User List</h1>
                {this.state.persons.map((person, index) => (
                    <div
                        key={index}
                        className="card mb-3"
                        style={{ backgroundColor: '#17a2b8', color: 'white', padding: '15px', margin: '15px', borderRadius: '10px' }}
                    >
                        <div className="row no-gutters">
                            <div className="col-md-3">
                                <img
                                    src={person.picture.large}
                                    alt={person.name.first}
                                    style={{
                                        borderRadius: '50%',
                                        width: '150px',
                                        height: '150px',
                                        objectFit: 'cover',
                                        margin: 'auto',
                                        display: 'block',
                                    }}
                                />
                            </div>
                            <div className="col-md-9">
                                <div className="card-body">
                                    <h5 className="card-title">
                                        {person.name.title} {person.name.first} {person.name.last} - {person.login.uuid}
                                    </h5>
                                    <p className="card-text">User Name: <b>{person.login.username}</b></p>
                                    <p className="card-text">Gender: <b>{person.gender.toUpperCase()}</b></p>
                                    <p className="card-text">Time Zone Description: <b>{person.location.timezone.description}</b></p>
                                    <p className="card-text">
                                        Address: {person.location.street.number} {person.location.street.name}, {person.location.city}, {person.location.state}, {person.location.country} - {person.location.postcode}
                                    </p>
                                    <p className="card-text">Email: <b>{person.email}</b></p>
                                    <p className="card-text">Birth Date and Age: <b>{new Date(person.dob.date).toLocaleDateString()} ({person.dob.age} years)</b></p>
                                    <p className="card-text">Register Date: <b>{new Date(person.registered.date).toLocaleDateString()}</b></p>
                                    <p className="card-text">Phone: <b>{person.phone}</b></p>
                                    <p className="card-text">Cell: <b>{person.cell}</b></p>
                                    <button className="btn btn-primary">Details</button>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        );
    }
}

export default PersonList;
